const TabTwoContent = () => {
  return (
  	  <div className='content-box'>
  		<div className='content-left'>

  		</div>
  		<div className='content-right'>
  			<h1>Funded by readers like you. For readers like you.</h1>
	  		<p>This digital library is funded entirely by the people who use it. By becoming a curator, you are helping
